import {connect} from "react-dom"
function Redux({variable}){
    return(
        <div>
            <h3>React-Redux</h3>
            <h2>count:{variable}</h2>
        </div>
    )
}
const mapStateToProps=state=>({
    variable:state
})
export default connect(mapStateToProps) (Redux);
